import React from "react";

const pytorch_img = () => (
  <div>
    <span class="iconify" data-icon="logos-pytorch" data-inline="false" />
  </div>
);

const pytorch = {
  title: "PyTorch",
  icon: pytorch_img,
  value: "70"
};

export default pytorch;
